      'field_paragraph_title_value': '术语标化流程',
      'field_paragraph_content_value': '<p>标化系统完整实现上分为以下几个步骤：<\/p>\n<ul>\n<li>构建标准术语集：读取标准术语文件或者数据库表，进行标准术语的模型构建<\/li>\n<li>增补术语别名：通过将人工整理的术语别名数据导入系统，增加到标化模型的术语知识库<\/li>\n<li>术语标化：对业务术语按照type和目标version进行映射<\/li>\n<li>人工审核和反馈：将术语标化的结果进行分层审核，<em>例如匹配度大于<\/em><em>9<\/em><em>的免检，<\/em><em>0.7<\/em><em>到<\/em><em>0.9<\/em><em>的粗申，<\/em><em>0.5<\/em><em>到<\/em><em>0.7<\/em><em>细申，<\/em><em>0.5<\/em><em>以下标化结果只做人工标化参考。<\/em><\/li>\n<li>5） 将人工对照形成的标化映射以增补知识的形式反馈给系统，形成正循环。<\/li>\n<\/ul>\n<p>&nbsp;<\/p>',
