      'field_paragraph_title_value': '算法介绍',
      'field_paragraph_content_value': '<p><strong>数据挖掘<\/strong>是⼀项从⼤量的记录数据中提取有价值的、⼈们感兴趣的知识，这些知识是隐含的、事先未知的有⽤信息，提取的知识⼀般可表⽰为概念(Concepts)、规则(Rules)、规律(Regular ides)、模式(Patterns)等形式。<\/p>\n<p><strong>关联规则<\/strong>是当前数据挖掘研究的主要⽅法之⼀，它反映⼀个事物与其他事物之间的相互依存性和关联性。如果两个或者多个事物之间存在⼀定的关联关系，那么，其中⼀个事物就能够通过其他事物预测到。<\/p>\n<p><strong>典型的关联规则发现问题<\/strong>是对超市中的货篮数据（Market Basket）进行分析。通过发现顾客放⼊货篮中的不同商品之间的关系来分析顾客的购买习惯。<\/p>',
