      'field_paragraph_title_value': '基于Dremio的数据集成和数据即服务解决方案 ',
      'field_paragraph_content_value': '<p class="MsoNormal"><span lang="EN-US">Dremio<\/span><span style="font-family: 宋体; mso-ascii-font-family: \'Times New Roman\'; mso-hansi-font-family: \'Times New Roman\';">是一个数据即服务平台，用来取代重量级的数据仓库或者<\/span><span lang="EN-US">hive<\/span><span style="font-family: 宋体; mso-ascii-font-family: \'Times New Roman\'; mso-hansi-font-family: \'Times New Roman\';">系统，可以将完全不同来源的产品数据集成到一个可扩展的自助服务平台中，可以基于异构分布的数据使用<\/span><span lang="EN-US">SQL<\/span><span style="font-family: 宋体; mso-ascii-font-family: \'Times New Roman\'; mso-hansi-font-family: \'Times New Roman\';">语句创建新的数据集，而这些功能是无法通过单独的产品构建的。<\/span><span lang="EN-US">Dremio<\/span><span style="font-family: 宋体; mso-ascii-font-family: \'Times New Roman\'; mso-hansi-font-family: \'Times New Roman\';">消除了不必要的数据副本的创建，增强了管理和治理数据的能力。<\/span><\/p>\n<p class="MsoNormal"><span style="font-family: 宋体; mso-ascii-font-family: \'Times New Roman\'; mso-hansi-font-family: \'Times New Roman\';">主要特性：<\/span><\/p>\n<p class="MsoNormal" style="margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l0 level1 lfo1; tab-stops: list 36.0pt;"><!-- [if !supportLists]--><span lang="EN-US" style="font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;"><span style="mso-list: Ignore;">Ø<span style="font: 7.0pt \'Times New Roman\';">&nbsp; <\/span><\/span><\/span><!--[endif]--><span style="font-family: 宋体; mso-ascii-font-family: \'Times New Roman\'; mso-hansi-font-family: \'Times New Roman\';">从任何来源（从关系数据到<\/span><span lang="EN-US">NoSQL<\/span><span style="font-family: 宋体; mso-ascii-font-family: \'Times New Roman\'; mso-hansi-font-family: \'Times New Roman\';">，<\/span><span lang="EN-US">HDFS<\/span><span style="font-family: 宋体; mso-ascii-font-family: \'Times New Roman\'; mso-hansi-font-family: \'Times New Roman\';">，云存储）对数据进行受控且安全的访问，形成数据分析不需要数据仓库的新模式。<\/span><\/p>\n<p class="MsoNormal" style="margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l0 level1 lfo1; tab-stops: list 36.0pt;"><!-- [if !supportLists]--><span lang="EN-US" style="font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;"><span style="mso-list: Ignore;">Ø<span style="font: 7.0pt \'Times New Roman\';">&nbsp; <\/span><\/span><\/span><!--[endif]--><span style="font-family: 宋体; mso-ascii-font-family: \'Times New Roman\'; mso-hansi-font-family: \'Times New Roman\';">基于列式存储，在大型数据集上具有极佳<\/span><span lang="EN-US">SQL<\/span><span style="font-family: 宋体; mso-ascii-font-family: \'Times New Roman\'; mso-hansi-font-family: \'Times New Roman\';">性能。内置加速器可以加速对任何规模的任何数据源的查询，可支持直接在生产库上查询而不用担心对生产系统形成压力。<\/span><\/p>\n<p class="MsoNormal" style="margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l0 level1 lfo1; tab-stops: list 36.0pt;"><!-- [if !supportLists]--><span lang="EN-US" style="font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;"><span style="mso-list: Ignore;">Ø<span style="font: 7.0pt \'Times New Roman\';">&nbsp; <\/span><\/span><\/span><!--[endif]--><span style="font-family: 宋体; mso-ascii-font-family: \'Times New Roman\'; mso-hansi-font-family: \'Times New Roman\';">内置数据目录，数据目录为数据使用者提供了一种直观和层次化的方法，可以以受控和安全的模式组织数据。数据管理员可以描述和标记数据集。数据使用者搜索界面来查找所需的数据，然后立即开始进行整理，混合或分析。<\/span><\/p>\n<p class="MsoNormal" style="margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l0 level1 lfo1; tab-stops: list 36.0pt;"><!-- [if !supportLists]--><span lang="EN-US" style="font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;"><span style="mso-list: Ignore;">Ø<span style="font: 7.0pt \'Times New Roman\';">&nbsp; <\/span><\/span><\/span><!--[endif]--><span style="font-family: 宋体; mso-ascii-font-family: \'Times New Roman\'; mso-hansi-font-family: \'Times New Roman\';">弹性和高可用性的部署。可以使用流行的云服务简化本地部署的管理，以配置和弹性扩展多达<\/span><span lang="EN-US">1000<\/span><span style="font-family: 宋体; mso-ascii-font-family: \'Times New Roman\'; mso-hansi-font-family: \'Times New Roman\';">多个节点的集群。<\/span><\/p>\n<p class="MsoNormal" style="margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l0 level1 lfo1; tab-stops: list 36.0pt;"><!-- [if !supportLists]--><span lang="EN-US" style="font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;"><span style="mso-list: Ignore;">Ø<span style="font: 7.0pt \'Times New Roman\';">&nbsp; <\/span><\/span><\/span><!--[endif]--><span lang="EN-US">SQL<\/span><span style="font-family: 宋体; mso-ascii-font-family: \'Times New Roman\'; mso-hansi-font-family: \'Times New Roman\';">语言扩展，支持对嵌套数据集的查询（嵌套数据集指数据字段本身是对象，传统关系数据库不支持此类查询），增强对非结构化数据结构的查询。<\/span><\/p>',
